INSERT /*+ APPEND */ INTO	<?=odiRef.getSchemaName("RSTG_ORACLE", "D") ?>.STG_OFFER_PAYG_TAR_TAL 
( 
	OFFER_ID 
) 
SELECT
	OFFER_ID   
FROM ( 
	SELECT	/*+ PARALLEL(32) */ 
		DISTINCT_.OFFER_ID OFFER_ID 
	FROM	(
SELECT 
  DISTINCT 
  D.OFFER_ID AS OFFER_ID   
FROM 
  (((<?= odiRef.getObjectName("L", "PC_PRODUCT_OFFERING_TEMP", "EXTRACT_ORACLE", "D") ?> B  INNER JOIN  <?= odiRef.getObjectName("L", "PC_POP_COMPONENTS", "EXTRACT_ORACLE", "D") ?> A  
    ON  A.OFFER_ID=B.OFFER_ID
     )  INNER JOIN  <?= odiRef.getObjectName("L", "PC_BUNDLEPRODOFFER_REL", "EXTRACT_ORACLE", "D") ?> C  
    ON  B.OFFER_ID=C.CHILD_PROD_OFFER_ID
     )  INNER JOIN  <?= odiRef.getObjectName("L", "PC_PRODUCT_OFFERING_TEMP", "EXTRACT_ORACLE", "D") ?> D  
    ON  C.PAR_PROD_OFFER_ID=D.OFFER_ID
     )  INNER JOIN  (((<?= odiRef.getObjectName("L", "KNN_0_COMPONENT_DEFINITION_VALUES", "EXTRACT_ORACLE", "D") ?> KNN_0_COMPONENT_DEFINITION_VALUES  INNER JOIN  <?= odiRef.getObjectName("L", "TEMP_STG_OFFER_PAYG_TAR_TAL_3", "RSTG_ORACLE", "D") ?> TEMP_STG_OFFER_PAYG_TAR_TAL_3  
    ON  KNN_0_COMPONENT_DEFINITION_VALUES.COMPONENT_ID = TEMP_STG_OFFER_PAYG_TAR_TAL_3.COMPONENT_ID
     )  LEFT OUTER JOIN  <?= odiRef.getObjectName("L", "TEMP_STG_OFFER_PAYG_TAR_TAL_2", "RSTG_ORACLE", "D") ?> TEMP_STG_OFFER_PAYG_TAR_TAL_2  
    ON  KNN_0_COMPONENT_DEFINITION_VALUES.COMPONENT_ID = TEMP_STG_OFFER_PAYG_TAR_TAL_2.COMPONENT_ID
     )  LEFT OUTER JOIN  <?= odiRef.getObjectName("L", "TEMP_STG_OFFER_PAYG_TAR_TAL_1", "RSTG_ORACLE", "D") ?> TEMP_STG_OFFER_PAYG_TAR_TAL_1  
    ON  KNN_0_COMPONENT_DEFINITION_VALUES.COMPONENT_ID = TEMP_STG_OFFER_PAYG_TAR_TAL_1.COMPONENT_ID
     )  
    ON  TO_CHAR (KNN_0_COMPONENT_DEFINITION_VALUES.COMPONENT_ID )= A.COMPONENT_ID
WHERE
  (D.X_VF_PRODUCT_GROUP='TARIFF'
) AND   (TEMP_STG_OFFER_PAYG_TAR_TAL_1.COMPONENT_ID IS NULL AND TEMP_STG_OFFER_PAYG_TAR_TAL_2.COMPONENT_ID IS NULL
) 
  ) DISTINCT_
	WHERE	(1=1) 
)  ODI_GET_FROM
